options.rowCallback:
function(row, data) {
DTWidget.formatCurrency(this, row, data, 5, '$', 0, 3, ',', '.', true);
DTWidget.formatCurrency(this, row, data, 2, '$', 0, 3, ',', '.', true);
DTWidget.formatCurrency(this, row, data, 4, '$', 0, 3, ',', '.', true);
DTWidget.formatPercentage(this, row, data, 3, 0, 3, ',', '.');
DTWidget.formatRound(this, row, data, 1, 0, 3, ',', '.');
}

ajax.data:
function(d) {
d.search.caseInsensitive = true;
d.search.smart = true;
d.escape = true;
var encodeAmp = function(x) { x.value = x.value.replace(/&/g, "%26"); }
encodeAmp(d.search);
$.each(d.columns, function(i, v) {encodeAmp(v.search);});
}
